resource "aws_instance" "" {
  ami = ""
  instance_type = ""
  subnet_id = aws_subnet..id
  vpc_security_group_ids = [aws_security_group..id]
  iam_instance_profile = aws_iam_instance_profile..id
  root_block_device {
    volume_size = ""
    volume_type = ""
    delete_on_termination = 
  }
}

resource "aws_subnet" "" {
  vpc_id = aws_vpc..id
  cidr_block = ""
  availability_zone = ""
  map_public_ip_on_launch = false
}

resource "aws_iam_role" "SSM_default" {
  name_prefix = "SSM"
  path = "/"
  assume_role_policy = data.aws_iam_policy_document.SSM.json
}

data "aws_iam_policy_document" "SSM" {
  statement {
    effect = "Allow"

    principals {
      type        = "Service"
      identifiers = ["ec2.amazonaws.com"]
    }

    actions = ["sts:AssumeRole"]
  }
}

resource "aws_iam_instance_profile" "SSM" {
  name_prefix = "SSM"
  role = aws_iam_role.SSM_default.id
}

data "aws_iam_policy" "AmazonEC2RoleforSSM" {
  arn = "arn:aws:iam::aws:policy/service-role/AmazonEC2RoleforSSM"
}
data "aws_iam_policy" "AmazonS3FullAccess" {
  arn = "arn:aws:iam::aws:policy/AmazonS3FullAccess"
}
data "aws_iam_policy" "CloudWatchAgentServerPolicy" {
  arn = "arn:aws:iam::aws:policy/CloudWatchAgentServerPolicy"
}

resource "aws_iam_role_policy_attachment" "cloudwiz-attachment-role-policy-1" {
  role       = aws_iam_role.SSM_default.id
  policy_arn = data.aws_iam_policy.AmazonEC2RoleforSSM.arn
}
resource "aws_iam_role_policy_attachment" "cloudwiz-attachment-role-policy-2" {
  role       = aws_iam_role.SSM_default.id
  policy_arn = data.aws_iam_policy.AmazonS3FullAccess.arn
}
resource "aws_iam_role_policy_attachment" "cloudwiz-attachment-role-policy-3" {
  role       = aws_iam_role.SSM_default.id
  policy_arn = data.aws_iam_policy.CloudWatchAgentServerPolicy.arn
}

