}

resource "aws_efs_mount_target" "" {
  file_system_id = aws_efs_file_system..id
  subnet_id      = aws_subnet..id
}

resource "aws_autoscaling_group" "" {
  launch_template {
    id      = aws_launch_template..id
    version = ""
  }

  min_size         = 
  max_size         = 
